            <Square color={squares[11]} onSquareClick={()=> handleClick(11)}/>
            <Square color={squares[12]} onSquareClick={()=> handleClick(12)}/>
            <Square color={squares[13]} onSquareClick={()=> handleClick(13)}/>
        </div>
